	class politicsapi {
		
		// Function to convert the JSON into a PHP Array.
		function object_2_array($data) {
			if(is_array($data) || is_object($data)) {
				$result = array(); 
				foreach ($data as $key => $value) { 
					$result[$key] = $this->object_2_array($value); 
				}
				return $result;
			}
			return $data;
		}
		
		// This function simply goes through the process of decoding and placing data into an assosiative array
		// Used immediately after an API call only.
		function decode_for_php($json) {
			$json = json_decode($json);
			$output = $this->object_2_array($json);
			return $output;
		}
		
